import './style.scss';

import React from 'react';

import { Footer, Header } from '../landingPage';

export class Admin extends React.Component {

    

    render() {
		return (
			<div>
                <Header></Header>
                
                <div className="input-group">
                <div class="input-group">
  <div class="form-outline">
    <input id="search-focus" type="search" id="form1" class="form-control" />
    <label class="form-label" for="form1">Search</label>
  </div>
  <button type="button" class="btn btn-primary">
    <i class="fas fa-search"></i>
  </button>
</div>
</div>
                <nav className="nav nav-pills nav-justified">
  <a className="nav-item nav-link active" href="#">Todos los pedidos</a>
  <a className="nav-item nav-link" href="#">Pedidos pendientes</a>
  <a className="nav-item nav-link" href="#">Pedidos entregados</a>
  
</nav>
<Footer></Footer>
</div>
);
}

}
